Presence
    .of({ 
         activities: [{ name: "deez nuts" }] 
    }) //starts the presence with "deez nuts".
    .repeated(prev => { 
        return {
            afk: true,
            activities: prev.activities?.map(s => ({ ...s, name: s.name+"s" }))
        };
    }, 10000)) //every 10 s, the callback sets the presence to the returned one.
